  03> WILLIAMS, Allen Donald Buchanan m on ** ** 1939 to WALLS, Elizabeth Marion
  Gwendoline
  b 04.02.1917 d 22.09.1983
  b ** ** **** d ** ** ****
  Allen m. at Christchurch. No children. Allen first farmed "Pawanui" station near Waipawa then exchanged
  this for his mother's Knight family land at "Pukemiro", Dannevirke. After his death "Pukemiro" was left
  in trust for the education and advancement of young farmers in the district.
  05> WILLIAMS, Muriel Buchanan m on 07.12.1905 to FAULKNER, Albert Joseph
  b 23.08.1883 d 13.11.1978
  b ** ** 1880 d 01.07.1925
  Muriel b. and m. at Te Aute and d. at Gisborne. Albert b. at Hastings, England and
  d. at Hastings, NZ. Albert's father was a doctor and signed on as a ship's doctor
  to come to New Zealand. His mother's maiden name was Giesen.
  Albert was a farm cadet at "Te Aute" where he met and married Muriel. They moved
  to the Gisborne district about 1906 and farmed "Wairakaia" and "Waihina" stations
  at Muriwai.
